        "content": {
            "rendered": "\n<p>\u00de\u00e6gilegt fl\u00e6\u00f0i-yoga sem hentar \u00f6llum, hvort sem \u00fe\u00fa ert a\u00f0 byrja e\u00f0a ert algj\u00f6rt \u201eyogan\u00f6rd\u201c.<\/p>\n\n\n\n<p>Yoga \u00e6fingar eru fr\u00e1b\u00e6r byrjun \u00e1 \u00feessari yndislegu viku, Unnar Geir lei\u00f0ir \u00fe\u00e1tttakendur \u00ed gegnum \u00e6fingar sem auka li\u00f0leika, styrk og jafnv\u00e6gi. T\u00edminn endar g\u00f3\u00f0ri dj\u00fapsl\u00f6kun.<\/p>\n",
            "protected": false
        },
