        "title": {
            "rendered": "Hinsegin or\u00f0list"
        },
        "content": {
            "rendered": "<p>\u00d3s Pressan, \u00f3hagna\u00f0drifin f\u00e9lagasamt\u00f6k rith\u00f6funda og sk\u00e1lda \u00e1 \u00cdslandi, tekur \u00ed fyrsta skipti \u00fe\u00e1tt \u00ed Hinsegind\u00f6gum og b\u00fd\u00f0ur til fj\u00f6ltyngds b\u00f3kmenntavibur\u00f0ar m\u00e1nudaginn 7. \u00e1g\u00fast \u00ed H\u00e1t\u00ed\u00f0arsal I\u00f0n\u00f3 \u00e1 1. h\u00e6\u00f0.<\/p>\n<p>Fram koma Fri\u00f0rik Agni \u00c1rnason, Rex Beckett, Dori Levitt Baldvinsson, Hertha Richardt \u00dalfarsd\u00f3ttir og Andie Sophie Fontaine, en \u00feau eiga \u00fea\u00f0 m.a. sameiginlegt a\u00f0 hafa fengi\u00f0 texta eftir sig birt \u00ed hinu fj\u00f6ltyngda b\u00f3kmenntat\u00edmariti, \u00d3s \u2013 The Journal, sem \u00d3s Pressan hefur gefi\u00f0 \u00fat fr\u00e1 \u00e1rinu 2016.<\/p>\n<p>Vi\u00f0bur\u00f0urinn er \u00f6llum opinn og a\u00f0 kostna\u00f0arlausu.<\/p>\n<p>Kynnir \u00e1 vi\u00f0bur\u00f0inum ver\u00f0ur Anna Vald\u00eds Kro, ein af stofnendum \u00d3s Pressunnar. H\u00fan veitir n\u00e1nari uppl\u00fdsingar um vi\u00f0bur\u00f0inn \u00ed s\u00edma 8631338 e\u00f0a \u00e1 netfangi\u00f0 avkro1978@gmail.com<\/p>\n",
            "protected": false
        },
        "excerpt": {
            "rendered": "<p>\u00d3s Pressan, \u00f3hagna\u00f0drifin f\u00e9lagasamt\u00f6k rith\u00f6funda og sk\u00e1lda \u00e1 \u00cdslandi, tekur \u00ed fyrsta skipti \u00fe\u00e1tt \u00ed Hinsegind\u00f6gum og b\u00fd\u00f0ur til fj\u00f6ltyngds b\u00f3kmenntavibur\u00f0ar m\u00e1nudaginn 7. \u00e1g\u00fast \u00ed H\u00e1t\u00ed\u00f0arsal I\u00f0n\u00f3 \u00e1 1. h\u00e6\u00f0. Fram koma Fri\u00f0rik Agni \u00c1rnason, Rex Beckett, Dori Levitt Baldvinsson, Hertha Richardt \u00dalfarsd\u00f3ttir og Andie Sophie Fontaine, en \u00feau eiga \u00fea\u00f0 m.a. sameiginlegt a\u00f0 hafa [&hellip;]<\/p>\n",
            "protected": false
        },
