        "title": {
            "rendered": "Vogue n\u00e1mskei\u00f0"
        },
        "content": {
            "rendered": "<p>Gestgjafi er R.E.C Arts Reykjav\u00edk<\/p>\n<p>Vi\u00f0 erum svo \u00f3tr\u00falega heppin a\u00f0 hafa TVO Ballroom LEGENDS fr\u00e1 NYC sem kenna <em>vogue-<\/em>vinnustofur fyrir okkur \u00ed \u00e1g\u00fast! \ud83c\udff3\ufe0f\u200d\u26a7\ufe0f\ud83c\udff3\ufe0f\u200d\ud83c\udf08\u2728<br \/>\nLegendary Omari Wiles (Omari NiNa Oricci) &amp; Legendary Monster Babylon:<br \/>\ninstagram.com\/@omari_wiles<br \/>\ninstagram.com\/@monster_babylon<\/p>\n<p>Komdu og l\u00e6r\u00f0u um <em>ballroom<\/em>-menninguna, hinsegin s\u00f6gu og Vogue fr\u00e1 \u00feeim allra bestu. Sem upphafsfe\u00f0ur h\u00fasa sinna (House of NiNa Oricci &amp; House of Babylon), hafa b\u00e6\u00f0i Omari og Monster veri\u00f0 \u00ed <em>ballroom-<\/em>samf\u00e9laginu \u00ed \u00e1ratugi og hafa b\u00e1\u00f0ir komi\u00f0 fram og mennta\u00f0 a\u00f0ra um heim allan. Ekki missa af \u00feessum vinnustofum \u00fev\u00ed \u00feetta er byrjunin \u00e1 s\u00f6gunni h\u00e9rna \u00e1 \u00cdslandi og \u00f3metanlegt a\u00f0 vera partur af henni.<\/p>\n<p><strong>Hven\u00e6r<\/strong>:<br \/>\nMi\u00f0vikudagur 9. \u00e1g\u00fast, 16:30-19:00<br \/>\nFimmtudagur 10. \u00e1g\u00fast, 16:30-19:00<br \/>\n(\u00de\u00fa getur s\u00f3tt a\u00f0ra e\u00f0a b\u00e1\u00f0ar vinnustofur, \u00fear sem \u00fea\u00f0 er n\u00fdtt efni \u00e1 hverjum degi!)<\/p>\n<p><strong>Hvar<\/strong>:<br \/>\nDansverkst\u00e6\u00f0i\u00f0 (Hjar\u00f0arhaga 47, 107 Reykjav\u00edk)<\/p>\n<p><strong>Kostna\u00f0ur:<\/strong><\/p>\n<p>Til a\u00f0 gera \u00feessar kennslustundir fj\u00e1rhagslega a\u00f0gengilegar fyrir samf\u00e9lagi\u00f0 er ver\u00f0i\u00f0 skalanlegt. \u00dea\u00f0 eru \u00fer\u00edr ver\u00f0flokkar \u00ed bo\u00f0i \u00e1 skr\u00e1ningarey\u00f0ubla\u00f0inu, en \u00fe\u00fa borgar \u00fea\u00f0 sem \u00fe\u00fa getur!<\/p>\n<p><span style=\"text-decoration: underline;\">1. Vi\u00f0 m\u00e6lum me\u00f0<\/span><br \/>\nEinst\u00f6k verkst\u00e6\u00f0i \u2013 6.000 kr., b\u00e6\u00f0i verkst\u00e6\u00f0i \u2013 10.500 kr<\/p>\n<p><span style=\"text-decoration: underline;\">2.\u201eFj\u00e1rhagurinn er \u00fer\u00f6ngur\u201c:<\/span><br \/>\nEinst\u00f6k verkst\u00e6\u00f0i \u2013 3.000 kr., B\u00e6\u00f0i verkst\u00e6\u00f0in \u2013 5.500 kr.<\/p>\n<p><span style=\"text-decoration: underline;\">3. \u201e\u00c9g get og vil hj\u00e1lpa \u00f6\u00f0rum\u201c:<\/span><br \/>\neitt verkst\u00e6\u00f0i \u2013 7.500 kr, b\u00e6\u00f0i verkst\u00e6\u00f0i \u2013 12.500 kr.<\/p>\n<p>&#8220;Borga\u00f0u \u00fea\u00f0 sem \u00fe\u00fa getur&#8221;<\/p>\n<p>\u2728Hva\u00f0 er <em>ballroom<\/em>-menning? \u00dea\u00f0 m\u00e1 rekja <em>ballroom-<\/em>menningu alveg aftur til Harlem, New York \u00ed kringum 1920. En <em>ballroom<\/em> eins og vi\u00f0 \u00feekkjum \u00fea\u00f0 \u00ed dag f\u00f3r a\u00f0 s\u00fdna sig \u00ed kringum 7. og 8. \u00e1ratuginn fr\u00e1 Black &amp; Latino LGBTQIA+ samf\u00e9laginu. <em>Ballroom<\/em> samanstendur af \u201eh\u00fasum\u201c (e\u00f0a \u201cfj\u00f6lskyldum\u201d sem hafa or\u00f0i\u00f0 til \u00ed samf\u00e9laginu af ney\u00f0 til \u00feess a\u00f0 hj\u00e1lpa hvert \u00f6\u00f0ru a\u00f0 komast af) \u00deessar fj\u00f6lskyldur standa saman og styrkja hvert anna\u00f0, efla sj\u00e1lfstraust og keppa svo um ver\u00f0laun \u00ed mismunandi flokkum \u00e1 svok\u00f6llu\u00f0um b\u00f6llum, flokkarnir eru t.d. (Runway, Face, Realness\u2026..) og byggist \u00ed \u00fea\u00f0 heila \u00e1 sj\u00e1lfseflandi \u00fe\u00e1ttum til a\u00f0 \u00f6\u00f0last \u00f6ryggi \u00ed okkur sj\u00e1lfum). Algengasti \u00feekkti flokkurinn \u00ed <em>ballroom<\/em> er dans sem kallast <em>Voguing<\/em>. <em>Ballroom<\/em> og <em>Vogue<\/em> m\u00e1 sj\u00e1 \u00ed heimildarmyndum eins og \u201eParis is Burning\u201c, sj\u00f3nvarps\u00fe\u00e1ttum eins og \u201ePose\u201c og HBO Max raunveruleikakeppninni \u201eLegendary\u201c. Komdu og fr\u00e6ddu \u00feig og l\u00e6r\u00f0u enn meira \u00e1 smi\u00f0junum!<\/p>\n<p>Vi\u00f0 viljum \u00feakka rausnarlegum styrktara\u00f0ilum Pink Iceland &amp; Dansverkst\u00e6\u00f0inu k\u00e6rlega fyrir a\u00f0 hj\u00e1lpa okkur a\u00f0 gera \u00feessar vinnustofur m\u00f6gulegar!<\/p>\n<p>www.instagram.com\/recartsrvk<\/p>\n",
            "protected": false
        },
