        "title": {
            "rendered": "DragH\u00fasi\u00f0 a\u00f0 kv\u00f6ldi: Drags\u00fdning og hei\u00f0ursath\u00f6fn"
        },
        "content": {
            "rendered": "\n<p>DragH\u00fasi\u00f0 kynnir st\u00f3rkostlega s\u00fdningu a\u00f0 kv\u00f6ldi 9. \u00e1g\u00fast! \u00dear ver\u00f0ur hinum m\u00f6gnu\u00f0u dragundrum \u00edslensku senunnar fagna\u00f0 sem aldrei fyrr. DragH\u00fasi\u00f0 hefur safna\u00f0 saman fj\u00f6lbreyttum dragkarakterum sem \u00e6tla a\u00f0 setja upp skemmtilegustu, villtustu og asnalegastu drags\u00fdningu sem Reykjav\u00edk hefur s\u00e9\u00f0!<\/p>\n\n\n\n<p>Til a\u00f0 fagna senunni okkar enn meira ver\u00f0ur haldin h\u00e1t\u00ed\u00f0leg vi\u00f0urkenningarath\u00f6fn \u00fear sem samf\u00e9lagi\u00f0 okkar mun velja \u00ferj\u00e1 dragkaraktera til a\u00f0 hei\u00f0ra fyrir s\u00edna vinnu \u00e1 \u00e1rinu.<\/p>\n\n\n\n<p>Titlarnir sem kosi\u00f0 er um eru: <\/p>\n\n\n\n<ul>\n<li>N\u00fdli\u00f0i \u00e1rsins (Newcomer of the Year)<\/li>\n\n\n\n<li>Svi\u00f0sfr\u00f6mu\u00f0ur \u00e1rsins (Performer of the Year) <\/li>\n\n\n\n<li>Brautry\u00f0jandi \u00e1rsins (Legacy Award). <\/li>\n<\/ul>\n\n\n\n<p>Athugi\u00f0 s\u00e9rstaklega a\u00f0 \u00feetta er ekki kosning um besta draglistamanninn \u00ed s\u00fdningunni, heldur vi\u00f0urkenning til f\u00f3lk sem hefur lagt sig fram \u00e1ri\u00f0 um kring vi\u00f0 a\u00f0 gera senuna okkar litr\u00edka og skemmtilega.<\/p>\n\n\n\n<p>Tilnefningar og kosning ver\u00f0a augl\u00fdst \u00feegar n\u00e6r dregur.<\/p>\n\n\n\n<p>Dyrnar opna kl. 19:30. S\u00fdningin byrjar kl. 20. <\/p>\n\n\n\n<p><em>\u00c1star\u00feakkir f\u00e1 stu\u00f0ningsa\u00f0ilar vi\u00f0bur\u00f0arins: Modus h\u00e1rstofa RVK og AK, NYX Cosmetics, MyBFF &lt;3 Beauty, Rafha Verslun, Sky Lagoon, KEA H\u00f3tel, Lady Brewery, Blush og Part\u00fdb\u00fa\u00f0in. Takk fyrir a\u00f0 sty\u00f0ja vi\u00f0 hinsegin list, \u00fei\u00f0 eru\u00f0 fr\u00e1b\u00e6r!<\/em><\/p>\n\n\n\n<p>DragH\u00fasi\u00f0 er samvinnuverkefni listaf\u00f3lks \u00far \u00edslensku dragsenunni sem tilheyrir h\u00f3punum Apocalypstick og House of Heart. \u00cd g\u00f3\u00f0u samstarfi vi\u00f0 Hinsegin daga fylla \u00feau Pride Center af dragi og gle\u00f0i heilan dag og kv\u00f6ld! Ef \u00fei\u00f0 vilji\u00f0 koma \u00e1 s\u00fdningu fyrir alla aldursh\u00f3pa fyrr um daginn m\u00e1 <a href=\"https:\/\/hinsegindagar.is\/program\/draghusid-dragsyning-fyrir-allan-aldur\/\"><strong><span style=\"text-decoration: underline;\"><em>finna hana h\u00e9r<\/em><\/span><\/strong><\/a>.<\/p>\n",
            "protected": false
        },
        "excerpt": {
            "rendered": "<p>DragH\u00fasi\u00f0 kynnir st\u00f3rkostlega s\u00fdningu a\u00f0 kv\u00f6ldi 9. \u00e1g\u00fast! \u00dear ver\u00f0ur hinum m\u00f6gnu\u00f0u dragundrum \u00edslensku senunnar fagna\u00f0 sem aldrei fyrr. DragH\u00fasi\u00f0 hefur safna\u00f0 saman fj\u00f6lbreyttum dragkarakterum sem \u00e6tla a\u00f0 setja upp skemmtilegustu, villtustu og asnalegastu drags\u00fdningu sem Reykjav\u00edk hefur s\u00e9\u00f0! Til a\u00f0 fagna senunni okkar enn meira ver\u00f0ur haldin h\u00e1t\u00ed\u00f0leg vi\u00f0urkenningarath\u00f6fn \u00fear sem samf\u00e9lagi\u00f0 okkar mun [&hellip;]<\/p>\n",
            "protected": false
        },
