        "content": {
            "rendered": "\n<p>Hin fr\u00e1b\u00e6ra h\u00fasdrottning Kiki Queer Bar, Faye Kn\u00fas, mun bj\u00f3\u00f0a upp \u00e1 fyrsta klassa kv\u00f6ldstund me\u00f0 dragi, h\u00famor, dansi og almennri vitleysu og gle\u00f0i. B\u00fa\u00f0u \u00feig undir a\u00f0 hl\u00e6ja \u00fear til t\u00e1rin streyma me\u00f0 \u00feessari drottningu, sem allt eins g\u00e6ti veri\u00f0 pabbi \u00feinn! H\u00fasi\u00f0 opnar kl:20:00. Enginn a\u00f0gangseyrir.<\/p>\n",
            "protected": false
        },
