            "og_title": "Opnun s\u00fdningarinnar GR\u00cdMUR - ",
            "og_description": "Veri\u00f0 innilega velkomin \u00e1 opnun s\u00fdningarinnar GR\u00cdMUR, fimmtudaginn 10. \u00e1g\u00fast kl 17:00. \u00c1ri\u00f0 1983 komu til landsins tveir norskir myndlistamenn \u00feeir G\u00f6ran Ohldieck og Kjetil Berge. Tilgangur fer\u00f0ar \u00feeirra var a\u00f0 setja upp st\u00f3ra s\u00fdningu \u00ed sal Norr\u00e6na h\u00fassins GR\u00cdMUR\/MASKER \u2013 yfir 200 lj\u00f3smyndaverk og skyggnur sem r\u00edk voru af hinsegin or\u00f0r\u00e6\u00f0u og fagurfr\u00e6\u00f0i. \u00dea\u00f0 [&hellip;]",
