        "content": {
            "rendered": "<p>Gott ve\u00f0ur, besta \u00fats\u00fdni\u00f0 og mesta fj\u00f6ri\u00f0 ver\u00f0ur \u00e1 Petersen sv\u00edtunni n\u00fana \u00e1 fimmtudag \u00ed Pride-vikunni. Milli klukkan 18 og 19 leika skemmtikraftar lausum hala \u00e1 milli bor\u00f0a. Fram koma burleskdrottning \u00cdslands Margr\u00e9t Maack, \u00edslensku dragdrottningarnar Lola Von Heart og Chardonnay Bubl\u00e9e, skoski kabarettfolinn Tom Harlow og kabarettan Daphne Always fr\u00e1 New York.<\/p>\n<p>S\u00fdningin hentar ekki b\u00f6rnum e\u00f0a \u00feeim sem \u00f3ttast undir mannsl\u00edkamans. Ekki snerta skemmtikrafta nema a\u00f0 fengnu sk\u00fdru leyfi til \u00feess.<\/p>\n",
            "protected": false
        },
