        "content": {
            "rendered": "\n<p> kynna me\u00f0 stolti: <strong>DRAG DJ\u00d3K 2023!<\/strong><\/p>\n\n\n\n<p>Fram koma st\u00f3rstj\u00f6rnurnar <strong>Black Peppa<\/strong> og <strong>Danny Beard <\/strong>\u00far RuPaul&#8217;s Drag Race UK.<\/p>\n\n\n\n<p>Auk \u00feeirra koma fram Agatha P, Gloria Hole, G\u00f3g\u00f3 Starr, Jenny Purr, Milo de Mix og Tom Harlow.&nbsp;<\/p>\n\n\n\n<p>Dansh\u00f6fundur: Rebecca Hidalgo<\/p>\n\n\n\n<p>Vegna mikillar eftirspurnar ver\u00f0a tv\u00e6r s\u00fdningar \u00ed \u00e1r!<\/p>\n\n\n\n<p><em>20 \u00e1ra aldurstakmark.<\/em><\/p>\n\n\n\n<p>kl. 18:00 &#8211; Meet &amp; greet<br>kl. 18:30 &#8211; H\u00fasi\u00f0 opnar fyrir almenna gesti<br>kl. 19:00 &#8211; fyrri s\u00fdning<br>kl. 22:00 &#8211; seinni s\u00fdning<\/p>\n\n\n\n<p><strong>Mi\u00f0aver\u00f0:<\/strong><\/p>\n\n\n\n<ul>\n<li>Fors\u00f6luver\u00f0: 5.400 kr.<\/li>\n\n\n\n<li>Almennt ver\u00f0: 6.400 kr.<\/li>\n\n\n\n<li>Meet &amp; greet: 4.400 kr.<br><strong>Athugi\u00f0: <\/strong>Mi\u00f0i \u00e1 Meet &amp; greet gildir ekki sem mi\u00f0i \u00e1 s\u00fdningu<\/li>\n<\/ul>\n",
            "protected": false
        },
        "excerpt": {
            "rendered": "<p> kynna me\u00f0 stolti: DRAG DJ\u00d3K 2023! Fram koma st\u00f3rstj\u00f6rnurnar Black Peppa og Danny Beard \u00far RuPaul&#8217;s Drag Race UK. Auk \u00feeirra koma fram Agatha P, Gloria Hole, G\u00f3g\u00f3 Starr, Jenny Purr, Milo de Mix og Tom Harlow.&nbsp; Dansh\u00f6fundur: Rebecca Hidalgo Vegna mikillar eftirspurnar ver\u00f0a tv\u00e6r s\u00fdningar \u00ed \u00e1r! 20 \u00e1ra aldurstakmark. kl. 18:00 [&hellip;]<\/p>\n",
            "protected": false
        },
