        "title": {
            "rendered": "Til tunglsins &#8211; Hinsegin jazz, drama og d\u00e6gurl\u00f6g"
        },
        "content": {
            "rendered": "\n<p>S\u00f6ngvararnir Helga Margr\u00e9t, Vigd\u00eds \u00de\u00f3ra og Villi \u00d3sk flytja, \u00e1samt hlj\u00f3msveit, jazz eftir hinsegin t\u00f3nsk\u00e1ld og flytjendur, \u00e1samt nokkrum af \u00feeirra upp\u00e1halds hinsegin perlum. \u00der\u00edeyki\u00f0 mun f\u00e6ra gestum ylh\u00fdra fr\u00f3\u00f0leiksmola um l\u00f6gin og hinsegin s\u00f6guna \u00e1 bakvi\u00f0 \u00feau.<\/p>\n\n\n\n<p>Vissir \u00fe\u00fa til a\u00f0 Fly me to the Moon v\u00e6ri hinsegin \u00e1starlag?<\/p>\n\n\n\n<p>Helga Margr\u00e9t Clarke, s\u00f6ngur<br>Vigd\u00eds \u00de\u00f3ra M\u00e1sd\u00f3ttir, s\u00f6ngur<br>Vilhj\u00e1lmur \u00d3sk Vilhj\u00e1lms, s\u00f6ngur<br>A\u00f0alhei\u00f0ur \u00deorsteinsd\u00f3ttir, p\u00edan\u00f3<br>Halli Gu\u00f0munds, kontrabassi<br>\u00deorsteinn J\u00f3nsson, trommari<br>Sigurr\u00f3s J\u00f3hannesd\u00f3ttir, trompet<\/p>\n\n\n\n<p>ATH. til draga\u00f0d\u00e1enda n\u00e6r og fj\u00e6r: t\u00f3nleikunum l\u00fdkur \u00ed t\u00edma fyrir Dragdj\u00f3k!<\/p>\n",
            "protected": false
        },
        "excerpt": {
            "rendered": "<p>S\u00f6ngvararnir Helga Margr\u00e9t, Vigd\u00eds \u00de\u00f3ra og Villi \u00d3sk flytja, \u00e1samt hlj\u00f3msveit, jazz eftir hinsegin t\u00f3nsk\u00e1ld og flytjendur, \u00e1samt nokkrum af \u00feeirra upp\u00e1halds hinsegin perlum. \u00der\u00edeyki\u00f0 mun f\u00e6ra gestum ylh\u00fdra fr\u00f3\u00f0leiksmola um l\u00f6gin og hinsegin s\u00f6guna \u00e1 bakvi\u00f0 \u00feau. Vissir \u00fe\u00fa til a\u00f0 Fly me to the Moon v\u00e6ri hinsegin \u00e1starlag? Helga Margr\u00e9t Clarke, s\u00f6ngurVigd\u00eds \u00de\u00f3ra [&hellip;]<\/p>\n",
            "protected": false
        },
