        "content": {
            "rendered": "\n<p>PRIDE ZUMBA 12. \u00e1g\u00fast \u00ed World Class Laugum kl. 11:30<br>\u00d6ll gle\u00f0ilegustu disk\u00f3, popp og &#8220;attitude&#8221; l\u00f6gin \u00ed \u00feessum s\u00e9rstaka \u00feema Zumba t\u00edma \u00ed tilefni af Reykjav\u00edk Pride! Komi\u00f0 og hiti\u00f0 upp fyrir gle\u00f0ig\u00f6nguna, veri\u00f0 litr\u00edk og h\u00fdr eins og regnboginn!<\/p>\n\n\n\n<p>Kennari: Fri\u00f0rik Agni<\/p>\n\n\n\n<p>World Class korthafar \u00feurfa ekki a\u00f0 grei\u00f0a fyrir t\u00edmann heldur einungis skr\u00e1 sig eins og venjulega \u00ed h\u00f3pt\u00edma. \u00deeir sem ekki eiga kort geta m\u00e6tt og greitt sig inn \u00ed stakan t\u00edma. Zumba hentar \u00f6llum en \u00fe\u00f3 er almennt aldursvi\u00f0mi\u00f0 16 \u00e1ra og eldri.<\/p>\n",
            "protected": false
        },
