                    "ID": 894,
                    "post_author": "12",
                    "post_date": "2012-08-01 11:37:51",
                    "post_date_gmt": "2012-08-01 11:37:51",
                    "post_content": "<blockquote>\u201eIf you can\u2019t respect me,\u00a0you\u2019ve got no business being here.\u201c\r\n\u2013Harvey vi\u00f0 m\u00f3\u00f0ur s\u00edna \u00ed\u00a0kvikmyndinni\u00a0Torch Song Trilogy<\/blockquote>\r\n\u00dea\u00f0 er engin tilviljun a\u00f0 ganga Hinsegin daga kennir sig vi\u00f0 gle\u00f0i. H\u00fan er sta\u00f0festing \u00e1 stolti sem f\u00e6stum okkar reyndist au\u00f0fengi\u00f0 og au\u00f0fundi\u00f0. Me\u00f0 gle\u00f0ig\u00f6ngunni f\u00f6gnum vi\u00f0 sigrum sem unnist hafa \u00ed mannr\u00e9ttindabar\u00e1ttu hinsegin f\u00f3lks \u00e1 \u00cdslandi og l\u00e1tum \u00ed lj\u00f3si \u00feakkl\u00e6ti til \u00e6ttingja okkar og vina fyrir a\u00f0 koma me\u00f0 \u00e1 b\u00e1tinn og standa me\u00f0 okkur af heilum hug. Me\u00f0 s\u00fdnileikanum styrkjum vi\u00f0 l\u00edka \u00fea\u00f0 f\u00f3lk sem vildi svo gjarnan brj\u00f3tast \u00fat \u00far sk\u00e1pnum en s\u00e9r enn\u00fe\u00e1 \u00e1st\u00e6\u00f0u til a\u00f0 hika.\r\n\r\n\u00dea\u00f0 stingur \u00feess vegna \u00ed st\u00faf vi\u00f0 markmi\u00f0 okkar \u00feegar mannvir\u00f0ing og jafnr\u00e9tti eru h\u00f6f\u00f0 a\u00f0 h\u00e1\u00f0i og spotti. \u00dea\u00f0 hefur gerst hva\u00f0 eftir anna\u00f0 hin s\u00ed\u00f0ustu \u00e1r a\u00f0 gagnkynhneigt f\u00f3lk sem veri\u00f0 er a\u00f0 steggja og g\u00e6sa fyrir br\u00fa\u00f0kaupi\u00f0 reynir a\u00f0 tro\u00f0ast \u00f3bo\u00f0i\u00f0 inn \u00ed gle\u00f0ig\u00f6nguna, ekki til a\u00f0 s\u00fdna samst\u00f6\u00f0u, heldur er tilgangurinn s\u00e1 a\u00f0 l\u00fdsa ni\u00f0url\u00e6gingu vi\u00f0komandi steggs e\u00f0a g\u00e6sar. \u201eHa, ha, auminginn, villtist inn\u00ed Gay Pride g\u00f6nguna! Er hann kannski hommi?!\u201c Myndbandsuppt\u00f6kur af \u201e\u00e6vint\u00fdrinu\u201c eru s\u00ed\u00f0an s\u00fdndar \u00ed br\u00fa\u00f0kaupsveislunni og hlegi\u00f0 d\u00e1tt a\u00f0 \u00f3f\u00f6rum br\u00fa\u00f0arinnar e\u00f0a br\u00fa\u00f0gumans.\r\n\r\n\u00de\u00e1tttakendum sem ganga gle\u00f0ig\u00f6ngu me\u00f0 mannr\u00e9ttindum, gegn ford\u00f3mum, er alls ekki bj\u00f3\u00f0andi a\u00f0 lenda vi\u00f0 hli\u00f0 einhvers sem s\u00fdnir g\u00f6ngunni og \u00fe\u00e1tttakendum \u00fe\u00e1 l\u00edtilsvir\u00f0ingu sem fylgir steggjum og g\u00e6sum \u00ed br\u00fa\u00f0kaupshuglei\u00f0ingum \u00e1 \u00feessum vettvangi. Vi\u00f0 bj\u00f3\u00f0um alla hjartanlega velkomna sem sl\u00e1st \u00ed h\u00f3p g\u00f6nguf\u00f3lks af g\u00f3\u00f0um hug \u2013 l\u00edka fuglana \u00e1 Tj\u00f6rninni ef \u00feeim b\u00fd\u00f0ur svo vi\u00f0 a\u00f0 horfa \u2013 en bi\u00f0jum \u00f3fi\u00f0ra\u00f0a steggi og fja\u00f0ralausar g\u00e6sir um a\u00f0 skemmta s\u00e9r \u00e1 \u00f6\u00f0rum vettvangi \u00feennan dag.",
