        "content": {
            "rendered": "<p>\u00dea\u00f0 ver\u00f0ur endalaus gle\u00f0i og glimmerstu\u00f0 \u00e1 G\u00f6tuboltavelli Nova \ud83d\udc9b\ud83d\udc9a\ud83d\udc99\ud83d\udc9c<br \/>\nM\u00e6ttu \u00e1 sv\u00e6\u00f0i\u00f0, glimmera\u00f0u \u00feig \u00ed gang, taktu lagi\u00f0 \u00ed karaoke og komdu \u00fe\u00e9r \u00ed gl\u00e6silegasta g\u00edrinn!<\/p>\n<p>Svona ver\u00f0ur \u00feetta! \ud83d\udc47\ud83c\udffc<br \/>\n\u272816:30\u2728 Glimmerm\u00e1lun \u00ed Fr\u00edttSt\u00f6ff!<br \/>\n\ud83c\udfa417:30\ud83c\udfa4 Opi\u00f0 Karaoke me\u00f0 Hits&amp;Tits!<\/p>\n<p>Vi\u00f0 ver\u00f0um me\u00f0 bolaprentun \u00e1 sv\u00e6\u00f0inu \u00fear sem \u00fe\u00fa getur l\u00e1ti\u00f0 prenta allt sem \u00fe\u00fa elskar \u00e1 bolinn \u00feinn \ud83d\udc9b\ud83d\udc55<\/p>\n<p>Gle\u00f0ilega hinsegin daga og elskum \u00f6ll!<\/p>\n",
            "protected": false
        },
        "excerpt": {
            "rendered": "<p>\u00dea\u00f0 ver\u00f0ur endalaus gle\u00f0i og glimmerstu\u00f0 \u00e1 G\u00f6tuboltavelli Nova \ud83d\udc9b\ud83d\udc9a\ud83d\udc99\ud83d\udc9c M\u00e6ttu \u00e1 sv\u00e6\u00f0i\u00f0, glimmera\u00f0u \u00feig \u00ed gang, taktu lagi\u00f0 \u00ed karaoke og komdu \u00fe\u00e9r \u00ed gl\u00e6silegasta g\u00edrinn! Svona ver\u00f0ur \u00feetta! \ud83d\udc47\ud83c\udffc \u272816:30\u2728 Glimmerm\u00e1lun \u00ed Fr\u00edttSt\u00f6ff! \ud83c\udfa417:30\ud83c\udfa4 Opi\u00f0 Karaoke me\u00f0 Hits&amp;Tits! Vi\u00f0 ver\u00f0um me\u00f0 bolaprentun \u00e1 sv\u00e6\u00f0inu \u00fear sem \u00fe\u00fa getur l\u00e1ti\u00f0 prenta allt sem \u00fe\u00fa [&hellip;]<\/p>\n",
            "protected": false
        },
