        "content": {
            "rendered": "\n<p>Hin eina sanna Sherry Vine er komin alla lei\u00f0 fr\u00e1 Bandar\u00edkjunum til a\u00f0 fagna me\u00f0 okkur 10 \u00e1ra afm\u00e6li Kiki Queer Bar! \u00cd s\u00fdningunni fer h\u00fan me\u00f0 \u00e1horfendur \u00ed s\u00f3\u00f0alegt fer\u00f0alag \u00ed gl\u00e6n\u00fdrri s\u00fdningu, st\u00fatfullri af s\u00f6ng, gr\u00edni og h\u00fdru glensi \u00fear sem sn\u00fai\u00f0 er \u00fat \u00far sl\u00f6gurum sem vi\u00f0 \u00f6ll \u00feekkjum! Mi\u00f0aver\u00f0 er einungis 2000 kr\u00f3nur, takmarka\u00f0 s\u00e6ta\u00farval svo tryggi\u00f0 ykkur mi\u00f0a \u00ed fors\u00f6lu e\u00f0a treysti\u00f0 \u00e1 lukkuna \u00ed hur\u00f0inni.<\/p>\n",
            "protected": false
        },
