        "title": {
            "rendered": "Fj\u00f6lskyldustund og S\u00f6gustund \u00e1 norsku"
        },
        "content": {
            "rendered": "\n<p>Veri\u00f0 velkomin \u00e1 S\u00f6gustund &amp; Verkst\u00e6\u00f0i \u00e1 Sunnudeginum 13.08 kl 11:30-13:30. Vi\u00f0 f\u00f6gnum saman me\u00f0 \u00fev\u00ed a\u00f0 lesa saman b\u00f3kina Ollianna.<\/p>\n\n\n\n<p>Ollianna er n\u00fd myndab\u00f3k fr\u00e1 Gro Dahle um a\u00f0 velta \u00fev\u00ed fyrir s\u00e9r hvort \u00fe\u00fa s\u00e9rt str\u00e1kur e\u00f0a stelpa og hva\u00f0 gerist ef \u00fe\u00fa \u00feorir a\u00f0 vera \u00fe\u00fa sj\u00e1lfur. H\u00f6fundarnir taka upp st\u00f3r \u00feemu eins og kyn og sj\u00e1lfsmynd.<\/p>\n\n\n\n<p>B\u00f3kin er fallega myndskreytt af Kaia Dahle Nyhus og eru tilfinningar Ol\u00ed\u00f6nnu dregnar fram me\u00f0 einf\u00f6ldum l\u00ednum og litum.<\/p>\n\n\n\n<p>\u201cOlli hefur alltaf veri\u00f0 Olli. Litli str\u00e1kur m\u00f6mmu og pabba. Pabbi vill ganga yfir m\u00fdrina og va\u00f0a yfir \u00e1na, hlaupa og vei\u00f0a og kl\u00edfa fjalls toppa og vill a\u00f0 Olli s\u00e9 sterkur. En Olli er me\u00f0 sterk augu og g\u00f3\u00f0a sj\u00f3n og s\u00e9r a\u00f0 Olli er ekki Olli. <br>Hva\u00f0 mun gerast ef hann ver\u00f0ur Ollianna? Vill pabbi kannski fara \u00ed fjallg\u00f6ngur me\u00f0 Oli\u00f6nnu?\u201d<\/p>\n\n\n\n<p>Olianna upplifir tilfinningar \u00ed gegnum liti og s\u00e9r m\u00f6mmu sem rau\u00f0a og pabba sem bl\u00e1an \u2013 (amk \u00feegar pabbi er rei\u00f0ur). Mamma er rau\u00f0 eins og dj\u00fapur og hl\u00fdr s\u00f3fi og v\u00f6rub\u00edll fullur af or\u00f0um. Olianna upplifir skilning og hl\u00fdju strax fr\u00e1 m\u00f3\u00f0ur sinni og gula hundinum s\u00ednum en seinna fr\u00e1 f\u00f6\u00f0ur s\u00ednum \u2013 eftir a\u00f0 hann l\u00e6r\u00f0i a\u00f0 sj\u00e1 og skilja betur.<\/p>\n\n\n\n<p>Eftir stuttan upplestur \u00e1 norsku er gestum bo\u00f0i\u00f0 a\u00f0 teikna og m\u00e1la tilfinningar \u00ed gegnum skemmtilegar \u00e6fingar.<\/p>\n\n\n\n<p>\u00d3keypis a\u00f0gangur og \u00f6ll velkomin!<\/p>\n\n\n\n<p>Athugi\u00f0 a\u00f0 a\u00f0gengi er fyrir hj\u00f3last\u00f3la \u00ed gegnum Hvelfingu, myndlistarr\u00fdmi.<\/p>\n\n\n\n<p>Vinnustofan fer fram \u00e1 norsku, \u00edslensku og ensku.<\/p>\n",
            "protected": false
        },
