        "content": {
            "rendered": "<p>H\u00fasdrottning Kiki Queer Bar, Faye Kn\u00fas, b\u00fd\u00f0ur \u00f6ll velkomin me\u00f0 s\u00e9r \u00e1 svi\u00f0 til a\u00f0 loka \u00feessari gle\u00f0iviku. Langar \u00feig \u00ed fyrsta skipti a\u00f0 skella \u00fe\u00e9r \u00ed drag? Kannski oft \u00ed dragi en aldrei komi\u00f0 fram \u00e1 svi\u00f0i? \u00der\u00e6lvanur dragk\u00f3ngur? E\u00f0a langar bara a\u00f0 \u00fdta undir allskonar kynusla? \u00de\u00e1 er \u00feetta kv\u00f6ldi\u00f0 fyrir \u00feig! Engin \u00fe\u00f6rf \u00e1 a\u00f0 skr\u00e1 sig, bara m\u00e6ta og vera me\u00f0 \u00ed kyntj\u00e1ningarveislunni. H\u00fasi\u00f0 opnar kl:20:00. Enginn a\u00f0gangseyrir.<\/p>\n",
            "protected": false
        },
